settings._cssCustom:
/* 
Begin List None
Change selector to .fr-social-alpha > ul" if
using on a parent container or rich text element.
*/
.fr-social-alpha {
  list-style: none;
  padding-inline-start: 0;
  margin-block: 0;
}

/* End List None */

.footer-november__list-ul {
  --border-style: 1px dashed var(--border-color-light);
  border: var(--border-style);
  border-radius: var(--radius);
}

.footer-november__billboard {
  --icon-size: 4em;
  --icon-color: var(--text-light);;
}

.footer-november__billboard svg {
  width: var(--icon-size);
  height: var(--icon-size);
  color: var(--icon-color);
  fill: var(--icon-color);
}

.footer-november__billboard svg path {
  fill: var(--icon-color);
}

.footer-november__billboard i {
  font-size: var(--icon-size);
  color: var(--icon-color);
}
